import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSearch, faTimesCircle } from '@fortawesome/free-solid-svg-icons'
import './receipt.scss';

class Receipt extends Component {
    constructor(){
        super();
        this.state={
            isWindowOpen: false
        }
    }

    closeWindow =()=>{
        this.setState({
            isWindowOpen: false,
        })
    }

    render(){
    return (
        <div className='receipt-container' style={{display: this.state.isWindowOpen ? 'flex' : 'none'}}>
            <div className='close' onClick={this.closeWindow}> <FontAwesomeIcon icon={faTimesCircle} /></div>
            <div className='content title'> Receipt </div>
            <div className='content'><FontAwesomeIcon icon={faSearch}/><input type='date' /></div>
            <div className='content'>Name: <span>John Doule</span></div>
            <div className='content'>result: <span>0  4  4  5  8</span></div>
            <div className='content'>Game: <span>Georgia</span></div>
            <div className='content'>status: <span>pending</span></div>
            <div className='content'>ticket: <span>1BsIy53CXk</span></div>
            <div className='content'>Seller: <span>John</span></div>
            <div className='content'>Date: <span>12/32/2020</span></div>

        </div>
    );
    }
};

export default Receipt;
